import { Route, Routes } from 'react-router-dom';

function NavBar() {
  const currentPath = window.return(
    <>
      <Routes>
        <Route path="*" element={<button className="header__navigation-button">Регистрация</button>} />
      </Routes>
    </>
  );
}

export { NavBar };
